import React,{Component} from 'react';

import banner1 from '../frontEndStyleing/img/promo-banner-1.jpg';
import banner2 from '../frontEndStyleing/img/promo-banner-2.jpg';
import banner3 from '../frontEndStyleing/img/promo-banner-3.jpg';
import banner4 from '../frontEndStyleing/img/promo-banner-4.jpg';
import banner5 from '../frontEndStyleing/img/promo-banner-5.jpg';
import poloshirt2 from '../frontEndStyleing/img/man/polo-shirt-2.png';
import poloshirt4 from '../frontEndStyleing/img/man/polo-shirt-4.png';
import poloshirt5 from '../frontEndStyleing/img/man/polo-shirt-5.png';
import poloshirt6 from '../frontEndStyleing/img/man/polo-shirt-6.png';
import poloshirt1 from '../frontEndStyleing/img/man/polo-shirt-1.png';
import tshirt1 from '../frontEndStyleing/img/man/t-shirt-1.png';
import girl1 from '../frontEndStyleing/img/women/girl-1.png';
import girl2 from '../frontEndStyleing/img/women/girl-2.png';
import girl3 from '../frontEndStyleing/img/women/girl-3.png';
import girl4 from '../frontEndStyleing/img/women/girl-4.png';
import girl5 from '../frontEndStyleing/img/women/girl-5.png';
import girl6 from '../frontEndStyleing/img/women/girl-6.png';
import girl7 from '../frontEndStyleing/img/women/girl-7.png';
import testimonial1 from '../frontEndStyleing/img/testimonial-img-1.jpg';
import testimonial2 from '../frontEndStyleing/img/testimonial-img-2.jpg'
import testimonial3 from '../frontEndStyleing/img/testimonial-img-3.jpg'
import java from '../frontEndStyleing/img/client-brand-java.png';
import joomla from '../frontEndStyleing/img/client-brand-joomla.png';
import html5 from '../frontEndStyleing/img/client-brand-html5.png';
import css3 from '../frontEndStyleing/img/client-brand-css3.png';
import jquery from '../frontEndStyleing/img//client-brand-jquery.png';
import wordpress from '../frontEndStyleing/img/client-brand-wordpress.png';
import sport1 from '../frontEndStyleing/img/sports/sport-1.png';
import sport2 from '../frontEndStyleing/img/sports/sport-2.png';
import sport3 from '../frontEndStyleing/img/sports/sport-3.png';
import sport4 from '../frontEndStyleing/img/sports/sport-4.png';
import sport5 from '../frontEndStyleing/img/sports/sport-5.png';
import sport6 from '../frontEndStyleing/img/sports/sport-6.png';
import sport7 from '../frontEndStyleing/img/sports/sport-7.png';
import sport8 from '../frontEndStyleing/img/sports/sport-8.png';
import electronic1 from '../frontEndStyleing/img/electronics/electronic-1.png';
import electronic2 from '../frontEndStyleing/img/electronics/electronic-2.png';
import electronic3 from '../frontEndStyleing/img/electronics/electronic-3.png';
import electronic4 from '../frontEndStyleing/img/electronics/electronic-4.png';
import electronic5 from '../frontEndStyleing/img/electronics/electronic-5.png';
import electronic6 from '../frontEndStyleing/img/electronics/electronic-6.png';
import electronic7 from '../frontEndStyleing/img/electronics/electronic-7.png';
import electronic8 from '../frontEndStyleing/img/electronics/electronic-8.png';
import lpoloshirt1 from '../frontEndStyleing/img/view-slider/large/polo-shirt-1.png';
import lpoloshirt2 from '../frontEndStyleing/img/view-slider/large/polo-shirt-2.png';
import lpoloshirt4 from '../frontEndStyleing/img/view-slider/large/polo-shirt-4.png';
import lpoloshirt3 from '../frontEndStyleing/img/view-slider/large/polo-shirt-3.png';
import mpoloshirt1 from '../frontEndStyleing/img/view-slider/medium/polo-shirt-1.png';
import mpoloshirt2 from '../frontEndStyleing/img/view-slider/medium/polo-shirt-2.png';
import mpoloshirt3 from '../frontEndStyleing/img/view-slider/medium/polo-shirt-3.png';
import mpoloshirt4 from '../frontEndStyleing/img/view-slider/medium/polo-shirt-4.png';
import tpoloshirt1 from "../frontEndStyleing/img/view-slider/thumbnail/polo-shirt-1.png";
import tpoloshirt3 from "../frontEndStyleing/img/view-slider/thumbnail/polo-shirt-3.png";
import tpoloshirt4 from "../frontEndStyleing/img/view-slider/thumbnail/polo-shirt-4.png";
import fashionBanner from '../frontEndStyleing/img/fashion-banner.jpg';
import MyCart from './MyCart';
import Slider from './Slider';
class Home extends Component {
  render(){
    return (
    <div>
              <Slider />
              <MyCart />
            {/* <!-- Client Brand --> */}
            <section id="aa-client-brand">
              <div className="container">
                <div className="row">
                  <div className="col-md-12">
                    <div className="aa-client-brand-area">
                      <ul className="aa-client-brand-slider">
                        <li><a href="#"><img src={java} alt="java img"/></a></li>
                        <li><a href="#"><img src={jquery} alt="jquery img"/></a></li>
                        <li><a href="#"><img src={html5} alt="html5 img"/></a></li>
                        <li><a href="#"><img src={css3} alt="css3 img"/></a></li>
                        <li><a href="#"><img src={wordpress} alt="wordPress img"/></a></li>
                        <li><a href="#"><img src={joomla} alt="joomla img"/></a></li>
                        <li><a href="#"><img src={java} alt="java img"/></a></li>
                        <li><a href="#"><img src={jquery} alt="jquery img"/></a></li>
                        <li><a href="#"><img src={html5} alt="html5 img"/></a></li>
                        <li><a href="#"><img src={css3} alt="css3 img"/></a></li>
                        <li><a href="#"><img src={wordpress} alt="wordPress img"/></a></li>
                      </ul>
                    </div>
                  </div>
                </div>
              </div>
            </section>
            {/* <!-- / Client Brand --> */}

    </div>
    );
  }
}

export default Home;
